import React, { useState } from "react";
import "./Contact.css";

function HandleForm(event, FormArray)
{

}

export default function Contact()
{
    const [name, SetName] = useState("");
    const [email, SetEmail] = useState("");
    const [status, SetStatus] = useState("");
    const [inquiry, SetInquiry] = useState("");
    const [body, SetBody] = useState("");
    const [checkbox_checked, SetCheckboxChecked] = useState("");

    function HandleSubmit(event)
    {
        event.preventDefault();
        const FormArray = [name, email, status, inquiry, body, checkbox_checked];
        HandleForm(event, FormArray);
    }

    return(
        <div id = "contact-wrapper">
            <div id = "contact-title">Contact Us</div>
            <form id = "contact-form">
                <label htmlFor = "contact-name-field">Name</label>
                <br />
                <input id = "contact-name-field" class = "contact-wide-input" />
                <label htmlFor = "contact-email-field">Email</label>
                <br />
                <input id = "contact-email-field" class = "contact-wide-input" />
                <label htmlFor = "contact-status-field">What is your registration status?</label>
                <br />
                <select id = "contact-status-field" class = "contact-wide-input">
                    <option value="">Select an option</option>
                    <option value="viola">I am a parent/guardian</option>
                    <option value="viola">Currently a student</option>
                    <option value="viola">I have registered to be a student, but I have not been placed</option>
                    <option value="viola">Currently a teacher</option>
                    <option value="viola">I have applied to be a teacher, but there has been no reply</option>
                    <option value="viola">I have not applied or registered but I am looking to</option>
                    <option value="viola">I want to know more about the program</option>
                </select>
                <label htmlFor = "contact-inquiry-field">What is your inquiry about?</label>
                <br />
                <select id = "contact-inquiry-field" class = "contact-wide-input">
                    <option value="">Select an option</option>
                    <option value="viola">General question</option>
                    <option value="viola">Request for update on registration status</option>
                    <option value="viola">Comment</option>
                    <option value="other">Other</option>
                </select>
                <label htmlFor = "contact-body-field">What is it that you would like to ask or let us know?</label>
                <br />
                <textarea id = "contact-body-field" class = "contact-wide-input" />
                <br />
                <input value = {checkbox_checked} onChange = {(e) => SetCheckboxChecked(!checkbox_checked)} id = "contact-faq-checkbox" type = "checkbox" />
                        <label htmlFor = "contact-faq-checkbox"> I have read the Q&A on the help page</label>
                        <br />
                        <br />
                <input type = "submit" id = "submit-button" />
            </form>
        </div>
    )
}
